import logo from './logo.svg';
//import './App.css';
import Main from "./Pages/Main";
import React,{ Component } from "react";
import Creators from "../src/Components/Creators";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom"

function App(){

        return(
           <Router>
               <Switch>
                   <Route path="/" Component={Main} />
               </Switch>
           </Router>
        )

}

export default App
